    if (activeStep !== 0) setActiveStep((prevActiveStep) => prevActiveStep - 1);
  };
  const handleSkip = () => {
    setActiveStep((prevActiveStep) => prevActiveStep + 1);
    setHoldId(localStorage.getItem("companyIdTemp"));
  };
  const handleSubmit = () => {
    setActiveStep((prevActiveStep) => prevActiveStep + 1);
  };
  const handleSelection = (navigate) => {
    setLeftNav(navigate);
  };

  const deleteCompanyUsingId = () => {
    loanDataService
      .deleteCompanyById(company.Id)
      .then((response) => {
        // console.log(response.data);
        navigate("/company");
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    const getCompanyAddressById = () => {
      setIsLoading(true);
      loanDataService
        .getCompanyAddress()
        .then((response) => {
          setGetAddress(response.data.Result);
          setAddressId(response.data.Result.Id);
        })
        .catch((e) => {
          console.log(e);
        });
      setIsLoading(false);
    };
    getCompanyAddressById();
  }, []);

  // setGetContactInformation
  useEffect(() => {
    const getCompanyContactInformationById = () => {
      setIsLoading(true);
      loanDataService
        .getCompanyContactInformation()
        .then((response) => {
          setGetContactInformation(response.data.Result);
          setContactInformationId(response.data.Result.Id);
        })
        .catch((e) => {
          console.log(e);
        });
      setIsLoading(false);
    };
    getCompanyContactInformationById();
  }, []);
  //   const handleId =(companyId) =>{
  // return companyId;
  // debugger
  //   }
