          {/* <AiFillEnvironment
                        className={`bg-amber-300 text-4xl rounded cursor-pointer block float-left mr-2 duration-500 ${open && "rotate-[360deg]  "
                            }`}
                    /> */}
          <img
            src={cbeLogo}
            height="40px"
            width="40px"
            className={`bg-amber-300 text-4xl rounded cursor-pointer block float-left mr-2 duration-500 ${
              open && "rotate-[360deg]"
            }`}
