                          id="Name"
                          label="Name"
                          variant="standard"
                          color="secondary"
                          size=""
                          required
                          sx={{ width: "45ch" }}
                          value={company.Name}
                          onChange={handleInputChange}
                          name="Name"
                          className="w-full max-w-full"
                        />
                        <TextField
                          id="NoOfBranch"
                          label="Number Of Branch"
                          variant="standard"
                          color="secondary"
                          size=""
                          required
                          value={company.NoOfBranch}
                          onChange={handleInputChange}
                          name="NoOfBranch"
                        />
                        <TextField
                          id="EstablishmentYear"
                          label="Establishment Year"
