                            </MenuItem>
                            {companyTypes.map((company) => (
                              <MenuItem key={company.Id} value={company.Id}>
                                {company.Name}
                              </MenuItem>
                            ))}
                          </Select>
                        </FormControl>

                        <TextField
                          id="VATNumber"
                          label="VAT Number"
                          variant="standard"
                          color="secondary"
                          size=""
                          required
                          value={company.VATNumber}
                          onChange={handleInputChange}
                          name="VATNumber"
                        />
                        <TextField
                          id="VATCertificate"
                          label="VAT Certificate"
                          variant="standard"
                          color="secondary"
                          size=""
                          required
                          value={company.VATCertificate}
                          onChange={handleInputChange}
                          name="VATCertificate"
                        />
                        <FormControl variant="standard" sx={{ minWidth: 120 }}>
                          <InputLabel id="EntityTypelbl" color="secondary">
                            {" "}
                            Entity Type
                          </InputLabel>
                          <Select
                            color="secondary"
                            onChange={(event) =>
                              (company.EntityTypeID = event.target.value)
                            }
                            labelId="EntityTypelbl"
                            id="EntityTypeSelect"
                            label="Entity Type"
                          >
                            <MenuItem value="">
                              <em>None</em>
                            </MenuItem>
                            {entityTypes.map((entity) => (
                              <MenuItem
                                key={entity.Id}
                                EntityTypeListID={entity.Id}
                                value={entity.Id}
                              >
                                {entity.Name}
                              </MenuItem>
                            ))}
                          </Select>
                        </FormControl>
                      </div>
