                    <th className="px-2 py-4"> No Branch </th>
                    <th className="px-2 py-4"> Establishment Year </th>
                    <th className="px-2 py-4"> TIN Number </th>
                    <th className="px-2 py-4"> TIN Certificate </th>
                    <th className="px-2 py-4"> VAT Number </th>
                    <th className="px-2 py-4"> VAT Certificate </th>
                    <th className="px-2 py-4"> Action </th>
