                        <td className="p-2">{company.EstablishmentYear}</td>
                        <td className="p-2">{company.TINNumber}</td>
                        <td className="p-2">{company.TINCertificate}</td>
                        <td className="p-2">{company.VATNumber}</td>
                        <td className="p-2">{company.VATCertificate}</td>
